/**
 * @param {number[]} nums
 * @return {number[]}
 */
var smallerNumbersThanCurrent = function (nums) {
  let Map = {};
  let arr = [];
  nums.forEach((num, index) => {
    for (let i = 0; i < nums.length; i++) {
      if (nums[i] < num) {
        if (Map[index]) Map[index] += 1;
        else Map[index] = 1;
      }
    }
  });
  nums.forEach((num, index) => {
    if (!Map[index]) Map[index] = 0;
    arr.push(Map[index]);
  });
  return arr;
};
