var rankTeams = function (votes) {
  if (votes.length === 1) return votes[0];
  let MapIndex = []; //权重
  let Map = {
  }
  votes.forEach((v,i) => {
    for(let j = 0, len = v.length; j < len;j++) {
      if(!Map[j]) Map[j] = [v[j]];
      Map[j].push(v[j]);
    }
  });
  function sortMost (arr,i) {
    let arrMap = {};
    arr.forEach( ar=> {
      if(arrMap[ar]) arrMap[ar]++;
      else arrMap[ar] = 1;
    });
    let keys = Object.keys(arrMap);
    let sortArrMap = keys.sort((a,b) => {
      return arrMap[a] > arrMap[b] ? -1 : 1;
    });
    return sortArrMap[i];
  }
  let mapKeys = Object.keys(Map);
  let most = [];
  mapKeys.forEach((key,index) => {
    most.push(sortMost(Map[key],0));
  })
  // let sortRank = keys.sort((a,b) =>{
  //   if(Map[a] > Map[b]) return -1;
  //   if(Map[a] === Map[b])  {
  //     return a < b ?  -1 : 1;
  //   }
  //   else return 1;
  // });
  return most.join("");
};
